import axios from 'axios';
// const url = 'htt'

const authenticationSignup = async (data) => {
    try {
        var response = await axios.post(`${url}/singup`, data);
    } catch (error) {
        console.log('error while signup:', error);
    }
};
export default authenticationSignup;
